import React from "react" ;
import ReactDOM from "react-dom" ;
import "./index.css" ; 

let count= 1; 
function greet(){

  console.log("clicked" + count++);
} ; 
ReactDOM.render(
  <>
    <div className="btnDiv">
    <button onClick={greet()} className="btn">increment</button>
    </div>
  </>
   ,document.getElementById("root")  
);
